import {
  Box,
  Button,
  Card,
  CardActions,
  CardContent,
  Typography,
} from '@mui/material';
import React, { ReactElement, useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { getData } from '../data';

const [data, setData] = useState([]);

useEffect(() => {
  getData().then((data: any) => {
    setData(data);
  });
}, []);

console.log(data);

// Uncomment to use the mock api calls.
// import * as api from '../mocks/api';
// TODO: get useEffect
// Grab ID from URL
// Make api call to get the same list /id
// display it on the page with a different render method

const ViewPatient = (): ReactElement => {
  const card = (
    <React.Fragment>
      <Link to={'/patients'}>[List Patient Link Example]</Link>
      <CardContent>
        <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
          Patient
        </Typography>
        <Typography variant="h6" component="div">
          Malenia, Blade of Miquella
        </Typography>
        <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
          Date of Birth
        </Typography>
        <Typography variant="body2">01/01/1999</Typography>
        <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
          Sex
        </Typography>
        <Typography variant="h6" component="div">
          Female
        </Typography>
        <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
          Email
        </Typography>
        <Typography variant="h6" component="div">
          goddessofrot@tree.com
        </Typography>
        <Typography sx={{ fontSize: 14 }} color="text.secondary" gutterBottom>
          Created at:
        </Typography>
        <Typography variant="h6" component="div">
          Year 2,305 age of the erdtree
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small">Learn More</Button>
      </CardActions>
    </React.Fragment>
  );

  return (
    <Box sx={{ minWidth: 275 }}>
      <Card variant="outlined">{card}</Card>
    </Box>
  );
};

export default ViewPatient;
